import styled from "styled-components";

export const Container = styled.div`
  width: 1440px;
  height: 1024px;
  border: 1px solid #c2c2c2;
  border-radius: 12px;
  margin: auto;

  &:before {
    content: "";
    flex: 1;
    background: #6e74f8;
    width: 57px;
    height: 100%;
  }
`;
